import React from 'react';
import Dashboard from '../../pages/Dashboard';

const Layout = () => {
    return (
        <Router>
             <Switch>
            <Route exact path="/" component={Dashboard} />
            <Redirect from="*" to="/" />
          </Switch>
        </Router>
    );
};

export default Layout;
